INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (12300148, 3001, 1, 1, "vo_minigame_1012_result_1080", 2, 9, 0, 1, 5, "まあまあな点数だけど、\n自分的に手ごたえはどう？\nダメだって思ってんなら、\nまだまだ伸びる余地ありね！", 0.0, 1);
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (12300149, 3001, 8, 1, "vo_minigame_1012_result_1081", 2, 9, 0, 1, 5, "うん、中々の出来ね！\nでもあんたはもっといい点\n取れるはずよ！\nもっと頑張りましょうか！", 2.21, 2);
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (12300150, 3001, 3, 1, "vo_minigame_1012_result_1082", 2, 9, 0, 1, 5, "ん～はっきり言って微妙ね！\nま、難しい問題だし、\n勉強すれば\n点数は上がっていくと思うわ！", 2.46, 2);
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (12300151, 3001, 3, 1, "vo_minigame_1012_result_1083", 2, 9, 0, 1, 5, "ん～…\n10点には届かなかったか～\n次は10点越え目指して\n頑張ってみない？", 2.94, 2);
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (12300152, 3001, 7, 1, "vo_minigame_1012_result_1084", 2, 9, 0, 1, 5, "はいお疲れ～\n点数的にはまあまあってとこね！\nま、超難問だし頑張ったわよ", 4.19, 3);
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (12300153, 3001, 1, 1, "vo_minigame_1012_result_1085", 2, 9, 0, 1, 5, "うん、かなり難しい問題なのに\n最後までやり遂げたわね\n次はもっといい点目指してみる？", 0.0, 3);
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (12300154, 3001, 3, 1, "vo_minigame_1012_result_1086", 2, 9, 0, 1, 5, "ちょっとミスが多かったかもね～\nでも間違えた所は復習して\n次は正解するわよー！", 2.63, 3);
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (12300155, 3001, 3, 1, "vo_minigame_1012_result_1087", 2, 4, 0, 1, 1, "あら…あんまり良くない点数ね～\nどうしたの、調子でも悪かった？\n次はもっと頑張りましょうか", 5.53, 1);
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (12300156, 3001, 3, 1, "vo_minigame_1012_result_1088", 2, 4, 9, 3, 1, "ん～…正解数は\n物足りないわね～\nもうちょっと勉強の時間\n増やしちゃおっか？", 0.01, 1);
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (12300157, 3001, 3, 1, "vo_minigame_1012_result_1089", 2, 4, 3, 1, 1, "ん～…あんたならもうちょと\nいい点取れんでしょ～？\nもっと頑張んなさいよ\n期待してやってんだからさ！", 4.15, 1);
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (12300158, 3001, 9, 1, "vo_minigame_1012_result_1090", 2, 4, 9, 9, 1, "ん～今のあんたには、\nこの問題は難しかったかしら…\n難易度下げてチャレンジするのも\nありかもね～？", 0.01, 2);
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (12300159, 3001, 3, 1, "vo_minigame_1012_result_1091", 2, 4, 0, 1, 1, "あんまり出来は良くないわね～\n難しい問題だししょうがないけど\n次はもっと頑張ってほしいわ！", 5.37, 2);
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (12300160, 3001, 3, 1, "vo_minigame_1012_result_1092", 2, 4, 0, 1, 1, "なるほど…\nちょっと苦手な問題が多かった？\nもう一度チャレンジ\nしてみましょうか～", 1.44, 2);
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (12300161, 3001, 3, 1, "vo_minigame_1012_result_1093", 2, 4, 0, 3, 1, "んん～…問題が難しすぎた？\n無理に難しい問題続けるより、\n難易度下げた方が\n勉強の効率良いかもよ～？", 0.0, 3);
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (12300162, 3001, 3, 1, "vo_minigame_1012_result_1094", 2, 4, 3, 9, 1, "…あんまり点数取れなかったわね\nこれはあたしにも難しい問題だし\nそう落ち込まなくても大丈夫！\n次頑張りましょ！", 2.91, 3);
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (12300163, 3001, 5, 1, "vo_minigame_1012_result_1095", 2, 4, 0, 1, 1, "ごめん、ちょっと難しすぎた？\nもう一度チャレンジするも良し、\n難易度を下げるも良し、\nあんたがやる気なら付き合うわ！", 2.61, 3);
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (12300164, 3001, 4, 1, "vo_minigame_1012_result_1096", 2, 0, 1, 2, 0, "ちょっとあんた…\nやる気ないわよね～！？\n次こんな点数取ったら\n怒るわよ！", 3.63, 1);
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (12300165, 3001, 6, 1, "vo_minigame_1012_result_1097", 2, 0, 1, 2, 0, "はあ…自分で何点取ったか\n分かってるわよね～…？\n０点よ０点！　舐めてんの！？", 4.16, 1);
