INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (12300169, 3001, 8, 1, "vo_minigame_1012_result_1101", 2, 0, 8, 4, 0, "ちょっと待って採点ミスかも…\n…いや合ってるわね。はい０点\n…って０点！？\nふざけんなーー！", 5.73, 2);
