INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (22300160, 3001, 4, 2, "vo_minigame_1012_result_2092", 2, 4, 3, 10, 1, "覚えても、すぐ忘れるんだけど\nどしたらいい？\nあ、そーゆうとき\nフクシューする感じ？", 4.29, 2);
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (22300161, 3001, 4, 2, "vo_minigame_1012_result_2093", 2, 4, 6, 8, 1, "ムズ過ぎ！\n頭パンクするかと思った…！\nヒデサイ、うちの頭\nふぅふぅして～", 4.64, 3);
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (22300162, 3001, 9, 2, "vo_minigame_1012_result_2094", 2, 4, 0, 5, 1, "おにムズ過ぎてテンサゲ～\nでもヒデサイがんばってるし\nうちもがんばる！", 3.14, 3);
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (22300163, 3001, 7, 2, "vo_minigame_1012_result_2095", 2, 4, 0, 4, 1, "ヒデサイと同じ点数で\nちょっち安心したかも\n一緒にがんばろーね！\n置いてっちゃやだよ？", 6.59, 3);
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (22300164, 3001, 3, 2, "vo_minigame_1012_result_2096", 2, 0, 0, 3, 0, "…まあ、これより下はないし\n次は大逆転\n点数爆上がりっしょ！", 0.0, 1);
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (22300165, 3001, 9, 2, "vo_minigame_1012_result_2097", 2, 0, 5, 10, 0, "０点じゃん…\nそだ、次はえんぴつ転がして\n選ぶ作戦やってみる？", 2.2, 1);
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (22300166, 3001, 4, 2, "vo_minigame_1012_result_2098", 2, 0, 6, 4, 0, "考えるの無理な時あるよね…\nヒデサイもそーゆう\n感じだったの？", 0.01, 1);
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (22300167, 3001, 6, 2, "vo_minigame_1012_result_2099", 2, 0, 3, 2, 0, "え、ヒデサイも０点？\nじゃあうちと一緒じゃん♪\nまあ焦んないで\nベンキョーしてこーよ！", 2.8, 2);
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (22300168, 3001, 9, 2, "vo_minigame_1012_result_2100", 2, 0, 6, 4, 0, "むむむ～…０点…！\n覚えてもすぐ忘れちゃうし\nベンキョーってマジ大変", 3.22, 2);
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (22300169, 3001, 4, 2, "vo_minigame_1012_result_2101", 2, 0, 11, 0, 0, "０点だね…\nでも、へーきへーき\nリベンジしたら、結果オーライ！", 2.1, 2);
